import React from 'react';
import {useSpring, animated} from 'react-spring'
import logo from './logo.png'
import {Link} from "react-router-dom";

function App() {
    const props = useSpring({
        opacity: 5,
        from: {opacity:0},
        config:{mass:10, tension:1, friction: 1}

    })

    return  ( 
        <div>
             <animated.img className="btn viewport-header"src={logo} style={props}>
        </animated.img>
        <animated.div style={props} className="viewport-header-about">
                    <Link className="launchTitle-about" to="./about">|    Flowers     |</Link>
                        <Link className="launchTitle-about" to="./portfolio">|    Styling     |</Link>

                        <Link className="launchTitle-about" to="./products">|   Installation  |</Link>
                </animated.div>
                <animated.div style={props} className="row about">
                    <h1>MEET BRENNA</h1>
                    <h3>Brenna Cavanaugh was born and raised in the mountains of Sun Valley, Idaho.  The natural flora + fauna of the area have brought great inspiration into her unique style.  She has worked in the art and garden field for over 10 years from jewelry design, to large scale set design, sustainable farming, to being Ketchum Flower Companyâ€™s lead designer for 5 years.</h3>

                </animated.div>
        </div>
    )

}

export default App;
